window.SDOC_MAP_MID_TO_NODES = {"1":{"MID":"5dec3171164f4e82b3d1fd1a88ccb20f","UID":"REQ-001","STATEMENT":"All requirements documentation shall be written in StrictDoc (.sdoc) format and the grammar of the requirements document shall be validated by the strictdoc tool.","_LINK":"REQ-001"},"2":{"MID":"97281c90fd9745749ceda0517122fa12","UID":"REQ-002","STATEMENT":"The tool shall analyze all images in the specified collection (2.2TB+) and generate sidecar files containing extracted metadata for each image.","_LINK":"REQ-002"},"3":{"MID":"63555c807c964e2aa9e3579b16df5a2d","UID":"REQ-003","STATEMENT":"EXIF data parsing shall be performed using the fast-exif-rs-py library for optimal performance.","_LINK":"REQ-003"},"4":{"MID":"a09f8cee8499452f82ff2d4dc3b6e5bb","UID":"REQ-004","STATEMENT":"Sidecar files shall be generated for each processed image containing extracted metadata (faces, objects, poses, EXIF data) using the image-sidecar-rust library (https://github.com/dapperfu/image-sidecar-rust).","_LINK":"REQ-004"},"5":{"MID":"d5774c9824484f619e8b26783801873e","UID":"REQ-005","STATEMENT":"A complete pyproject.toml file shall be included with all necessary dependencies including image-sidecar-rust, insightface, ultralytics, torch, and GPU acceleration libraries.","_LINK":"REQ-005"},"6":{"MID":"eebcaab4ee9d447b83f64b41552020a9","UID":"REQ-006","STATEMENT":"The tool shall operate exclusively on GPU hardware. CPU fallback shall be disabled and the tool shall fail if no GPU is available.","_LINK":"REQ-006"},"7":{"MID":"254ec56a1f0b42d3b76e48c3cea35903","UID":"REQ-021","STATEMENT":"There shall be no Python fallback for any external module which has been specifically called out in the requirements. The tool shall fail if any required external module is not available.","_LINK":"REQ-021"},"8":{"MID":"b4cfabf6981541678f40a4c77a8812b1","UID":"REQ-007","STATEMENT":"Face recognition shall be performed using the insightface library, the yolov8-face model, and the yolov11-face model.","_LINK":"REQ-007"},"9":{"MID":"8708c5bc16584ebe8e3bcb60c90eb746","UID":"REQ-008","STATEMENT":"Object detection shall be performed using the YOLOv12x model downloaded from https://github.com/ultralytics/assets/releases/download/v8.3.0/yolo12x.pt","_LINK":"REQ-008"},"10":{"MID":"57c6e22c40e04c2aaf7cf0c1c393d5fd","UID":"REQ-009","STATEMENT":"Human pose detection shall be performed using the YOLOv11-pose model.","_LINK":"REQ-009"},"11":{"MID":"e29b9f6676954d7e908e51426773f799","UID":"REQ-010","STATEMENT":"All code components shall be directly linked to specific requirements and labeled with the corresponding requirement ID (REQ-###).","_LINK":"REQ-010"},"12":{"MID":"948578fc2c5741089b4fc58268fe395e","UID":"REQ-011","STATEMENT":"The tool shall support checkpoint and resume functionality to allow processing to resume after interruption, tracking processed images to avoid reprocessing.","_LINK":"REQ-011"},"13":{"MID":"5f3dcfe9db414f1e94875a59df4d2bea","UID":"REQ-012","STATEMENT":"The tool shall provide real-time progress tracking with statistics including processing speed (images/sec, MB/sec), estimated time to completion (ETA), and a final summary report.","_LINK":"REQ-012"},"14":{"MID":"d8b4064411a8431bab9e610e64b35908","UID":"REQ-013","STATEMENT":"The tool shall implement idempotent processing by detecting and skipping already-processed images based on existing sidecar files, with options for selective reprocessing.","_LINK":"REQ-013"},"15":{"MID":"ae8a434bc4904faa9e8ac0d93864f1b1","UID":"REQ-014","STATEMENT":"The tool shall support configurable batch processing with memory-aware batch sizing to balance processing speed and GPU memory constraints.","_LINK":"REQ-014"},"16":{"MID":"71e2f7d2ed75431695d3f4713bd97147","UID":"REQ-015","STATEMENT":"The tool shall implement robust error handling to gracefully handle corrupted or unreadable images, log errors, continue processing, and report error statistics at completion with optional retry mechanisms.","_LINK":"REQ-015"},"17":{"MID":"ed40e3d3241048f6be4c4ff5cf31c244","UID":"REQ-016","STATEMENT":"The tool shall implement multi-level verbosity logging with support for verbose flags (-v through -vvvv): -vvvv for DEBUG level (10), -vvv for TRACE level with TQDM progress bars (12), -vv for VERBOSE level with detailed processing info (15), -v for DETAILED file-by-file processing (17), and default INFO level (20). Structured logging shall be configured with file destination options.","_LINK":"REQ-016"},"18":{"MID":"c3fb47713b13456e82a840aca80fa1a5","UID":"REQ-017","STATEMENT":"The tool shall support configuration file (YAML/TOML) for batch processing settings with CLI argument override capability.","_LINK":"REQ-017"},"19":{"MID":"66df270e691d434785e51d34d21fb795","UID":"REQ-018","STATEMENT":"The tool shall support image format filtering to specify which image formats to process, defaulting to common formats (JPEG, PNG, TIFF, RAW).","_LINK":"REQ-018"},"20":{"MID":"7772184861bd4aa4a82dbbdce9b9fc69","UID":"REQ-019","STATEMENT":"The tool shall provide an optional SQLite database index for extracted metadata to enable querying by faces, objects, poses, and EXIF tags.","_LINK":"REQ-019"},"21":{"MID":"7c7e2dbf138a404a80f5eded6a4efb73","UID":"REQ-022","STATEMENT":"The tool shall use PonyORM as the Object-Relational Mapping (ORM) framework for database operations.","_LINK":"REQ-022"},"22":{"MID":"0165ada188b14974802d59e8aed84180","UID":"REQ-023","STATEMENT":"Each PonyORM model entity (Image, Face, Object, Pose, EXIFData) shall be defined in a separate file within the db module directory.","_LINK":"REQ-023"},"23":{"MID":"14f10d21dd75488ca356ffb447d755af","UID":"REQ-024","STATEMENT":"The database schema shall implement relational design with proper foreign key relationships: Image (1:N with Face, Object, Pose), Image (1:1 with EXIFData, ImageMetadata).","_LINK":"REQ-024"},"24":{"MID":"177a63cdb45149a7850a868f77387116","UID":"REQ-025","STATEMENT":"The tool shall support database storage mode with the --db flag specifying the database file path. When specified, metadata shall be stored in the database.","_LINK":"REQ-025"},"25":{"MID":"720983dc06d34d56af2e02c1976bd174","UID":"REQ-026","STATEMENT":"The tool shall support the --no-sidecar flag to disable sidecar file generation when using database storage mode.","_LINK":"REQ-026"},"26":{"MID":"9a77d5e54a6e4da89d265ed421f2988b","UID":"REQ-027","STATEMENT":"The tool shall support concurrent storage to both database and sidecar files when --db is specified without --no-sidecar.","_LINK":"REQ-027"},"27":{"MID":"1a1ba0e44b994a64b639cf2d0dcbf28a","UID":"REQ-028","STATEMENT":"The database schema shall be designed to support efficient querying by face embeddings, object classes, pose keypoints, and EXIF tags without requiring schema changes for new query patterns.","_LINK":"REQ-028"},"28":{"MID":"7c360924da87469b9acab91506165866","UID":"REQ-020","STATEMENT":"The tool shall implement performance optimization including parallel processing with thread-based I/O operations, batch processing for GPU acceleration, and optimized default batch sizing based on available VRAM (default 4 images per batch for 12GB VRAM).","_LINK":"REQ-020"},"29":{"MID":"1f041c1e4a5c4551869bb3a090a67de2","UID":"REQ-029","STATEMENT":"The tool shall support subcommand-based CLI operation with commands: extract (extract features from images), annotate (add features to images), and convert (migrate data between sidecar and database formats).","_LINK":"REQ-029"},"30":{"MID":"c96a9c41d0704c84a456a1c5d2fa18f6","UID":"REQ-030","STATEMENT":"The 'extract' subcommand shall process images and extract features including faces, objects, poses, and EXIF data, storing results in sidecar files and/or database as specified by configuration.","_LINK":"REQ-030"},"31":{"MID":"502fefbe56b44ac7b268ed2aa55c2be9","UID":"REQ-031","STATEMENT":"The 'annotate' subcommand shall process images and add features (faces, objects, poses, EXIF data) as annotations, storing results in sidecar files and/or database as specified by configuration.","_LINK":"REQ-031"},"32":{"MID":"a6b039415cb04797a317904e6afe612b","UID":"REQ-032","STATEMENT":"The 'convert' subcommand shall support importing existing sidecar files into the database, allowing migration from sidecar-only storage to database storage.","_LINK":"REQ-032"},"33":{"MID":"eada5d1292094c2dac20090bcc3ef950","UID":"REQ-033","STATEMENT":"The 'convert' subcommand shall support exporting database contents to sidecar files, allowing extraction of database-stored features to individual sidecar JSON files.","_LINK":"REQ-033"},"34":{"MID":"25a6c3466e2e4d4c93ec2d19d027f5b9","UID":"REQ-034","STATEMENT":"The 'convert' subcommand shall provide --direction flag with values 'to-db' (import sidecar to database) and 'to-sidecar' (export database to sidecar).","_LINK":"REQ-034"},"35":{"MID":"a318061d774f470fbe70053bfa62ae90","UID":"REQ-035","STATEMENT":"All Python functions and files SHALL be documented to meet NumPy documentation standards as specified in the NumPy documentation style guide.","_LINK":"REQ-035"}};
